import React, { Component } from 'react'

class sobreMim extends Component {
  render(){
    return <div><h1>Sou a Pedrita!!!</h1>
    <p>Sou uma dog dorminhoca!</p></div>
  }
}

class habilidades extends Component {
  render(){
    return <div><h2>Minhas Habilidades</h2>
    <ul>Dormir</ul><ul>Latir</ul><ul>Comer</ul></div>
  }
}

export { habilidades, sobreMim }
